B.Nd=new A.m(!0,B.k,null,null,null,null,18,B.w,null,null,null,null,null,null,null,null,null,B.lp,null,null,null,null,null,null,null,null)
B.KI=new A.ap("\nRead More",null,B.m,B.Nd)
B.K6=new A.ap("\n\nArmyworms are caterpillars that attack rice. There are at least three species of armyworm which attack rice in Asia. These are the rice swarming caterpillar, common cutworm, and the rice ear-cutting caterpillar.\n\nA single armyworm egg mass contains hundreds of eggs. Each female lays 800\u22121000 eggs during its lifetime of about one week.",null,B.m,B.r)
B.K_=new A.ap("\n\nArmyworm feeds on rice by cutting off leaves and young seedlings at the plants base. They can also cut off rice panicles from base.",null,B.m,B.r)
B.Kk=new A.ap("\n\nAdult armyworms survive better and produce more eggs when the temperature is at 15\xb0C maximum, and when plants are naturally fertilized. Periods of drought followed by heavy rains, and the presence of alternate hosts also sustain the development of armyworms.\n\nArmyworms are nocturnal.\n\nThe larvae usually feed in the upper portion of the rice canopy on cloudy days or at night; while the adult feeds, mates, and migrates at night and rests in daytime at the base of the plant.\n\nIn dryland fields, armyworm pupa can be found in the soil or at the base of the rice plants. In wetlands, they pupate on the plants or on grassy areas along the field borders.",null,B.m,B.r)
B.KR=new A.ap("\n\nCheck for feeding damage.\n\nArmyworms feed on leaf tips and along leaf margins. When they eat whole leaves, they can remove them completely or leave only the midribs.\n\nArmyworm damage can be mistaken for cutworm feeding. The characteristic form of armyworm damage is leaf removal. To confirm, check for the presence of the insect and its egg mass.",null,B.m,B.r)
B.KK=new A.ap("\n\nFlooding seedbeds are the best defense against armyworms.\n\nTo prevent armyworm infestation: \n\n\u25cf Establish seedbeds far from large areas of weeds.\n\n\u25cf Plow fallow land.\n\n\u25cf Clean the field and remove weeds.\n\n\nTo control: \n\n\u25cf Place ashes in the trenches to make it more difficult for the caterpillars to escape.\n\n\u25cf Place branches around fields to give armyworms a place to congregate where they are easily collected by hand.\n\n\u25cf Avoid killing natural enemies of armyworms such as wasps and spiders.Insecticides should be the last resort for armyworm control.\n\n\n",null,B.m,B.r)
B.DE=A.a(s([B.K6,B.ls,B.K_,B.b3,B.Kk,B.b1,B.KR,B.b2,B.KK]),t.R)
B.KT=new A.ap(null,B.DE,B.m,null)
B.Kd=new A.ap("\n\nShort-horned grasshopper and Oriental migratory locust both infest the rice plant and have similar feeding damage.",null,B.m,B.r)
B.Ku=new A.ap("\n\nFeeding damage caused by short-horned grasshoppers and oriental migratory locusts results in cutting out areas on leaves and cut-off panicles. They both feed on leaf margins.",null,B.m,B.r)
B.KG=new A.ap("\n\nAquatic environments are suitable for the development of short-horned grasshoppers, while locusts may prefer dry environments. Both are favored by the presence of alternate hosts.\n\nThe short-horned grasshoppers are common in moist and swampy areas. These nocturnal insect pests are abundant during September and October.\n\nOriental migratory locusts are commonly found in all rice environments, but they are more concentrated in rainfed areas. They dominate the irrigated rice environment surrounded by grassland breeding grounds. Both the adults and the nymphs are nocturnal and feed on the rice foliage at night. In the daytime, they hide at the base of the plant. Under favorable conditions, the adults swarm and migrate.",null,B.m,B.r)
B.KD=new A.ap("\n\nCheck for feeding damage, such as \n\n\u25cf feeding marks on leaves and shoots,\n\n\u25cf large portions of leaf edges consumed, and\n\n\u25cf cut-off panicles.\n\n\nCheck for insect presence: \n\n\u25cf eggs in pods\n\n\u25cf presence of yellow and brown nymphs and adults feeding on rice foliage\n\nGrasshopper and locust damage can be confused with damage caused by other defoliators. To confirm, find the insect and the characteristic form of leaf damage.",null,B.m,B.r)
B.Kb=new A.ap("\n\n\u25cf Flood the stubbles, shave bunds, sweep along the bunds, and pick adults directly from the foliage at night when they are sluggish.\n\n\u25cf Encourage biological control agents: scelionid wasps, parasitic flies, nematodes, and fungal pathogens, birds, frogs, and web-spinning spiders, and a certain species of an entomophthoralean fungus; and platystomatid fly and mite (eggs of oriental migratory locust), ants, birds, bats, field rats, mice, wild pigs, dogs, millipedes, fish, amphibia, reptiles, and monkeys.\n\n\u25cf Use poison baits from salt water and rice bran.\n\n\u25cf Use foliar sprays to control grasshoppers in rice fields. Granules are not effective.\n\n\n",null,B.m,B.r)
